    $(document).ready(function () {
      $(".slider-detail").slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        active: true,
        fade: true,
        asNavFor: ".slider-img",
        dots: false,
        infinite: true,
        speed: 3000,
        autoplay: true,
      });
      $(".slider-img").slick({
        vertical: true,
        verticalSwiping: true,
        slidesToShow: 1,
        slidesToScroll: 1,
        asNavFor: ".slider-detail",
        dots: false,
        arrows: false,
        focusOnSelect: true,
        infinite: true,
        speed: 3000,
        autoplay: true,
      });
      $(".slider-arr-up").click(function () {
        $(".slider-img").slick("slickNext");
      });
      $(".slider-arr-down").click(function () {
        $(".slider-img").slick("slickPrev");
      });
    });

